      "snippet": {
        "publishedAt": "2023-03-14T08:49:35Z",
        "channelId": "UCcN3IuIAR6Fn74FWMQf6lFA",
        "title": "What Have Sunflowers Got To Do With Nuclear Disasters?",
        "description": "Sunflowers are the international symbol for nuclear disarmament. You will most likely find sunflowers around areas where nuclear disasters have occurred in the past. Following the 1986 meltdown at the Chernobyl Power Plant in Ukraine, which released over 100 radioactive elements into the environment, sunflowers were planted in droves to extract the radioactive isotopes from the fallout-impacted sites. This approach is based on the principle of phytoremediation, which employs the use of plants to cleanse the environment.\n\nThe Chernobyl sunflower project was born in 1994 when a New Jersey-based company planted sunflowers on a floating raft with the intention to absorb radioactive isotopes from the water. It was observed that the plants selectively absorbed radio-cesium (137Cs) and radio-strontium (90Sr) from the water, and results indicated that about 95% of the radio-nuclides had been cleared out in a span of only ten days. In this video, we explore this magical ability of sunflowers in more detail.\n\n#sunflower #nuclear #science \n\nVideo on Radioactivity: https://youtu.be/M0uw4ZNpqcI\n\nReferences:\nhttps://www.world-nuclear.org/information-library/safety-and-security/safety-of-plants/chernobyl-accident.aspx\nhttps://doi.org/10.1111/j.1749-6632.2009.04831.x\nhttps://doi.org/10.1016/j.scitotenv.2013.10.029\nhttps://doi.org/10.1007/s42452-021-04301-4\nhttps://www.iaea.org/newscenter/focus/chernobyl/faqs\nhttps://doi.org/10.1007/978-981-10-2314-9_49\nhttps://doi.org/10.1038/s41598-020-64812-9\n\nOriginal Article Link: https://www.scienceabc.com/nature/why-were-sunflowers-planted-in-the-shadow-of-nuclear-disasters.html\n\nIf you wish to buy/license this video, please write to us at admin@scienceabc.com.\n\nVoice Over Artist: John Staughton ( https://www.fiverr.com/jswildwood )\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow us on Instagram!\nhttps://www.instagram.com/scienceabcofficial/ \n\nFollow us on LinkedIn!\nhttps://www.linkedin.com/company/scienceabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
