        "description": "Try out my quantum mechanics course (and many others on math and science) on Brilliant using the link https://brilliant.org/sabine. You can get started for free, and the first 200 will get 20% off the annual premium subscription.\n\nDoes time really slow down when you move? What about gravitational fields? What's the resolution to the twin paradox and what's up with Newton's bucket. In this video, I tell you how it really works. \n\nüëâ Transcript and References on Patreon ‚ûú https://www.patreon.com/Sabine\nüíå Sign up for my weekly science newsletter. It's free!  ‚ûú https://sabinehossenfelder.com/newsletter/\nüìñ Check out my new book \"Existential Physics\" ‚ûú http://existentialphysics.com/\nüîó Join this channel to get access to perks ‚ûú \nhttps://www.youtube.com/channel/UC1yNl2E66ZzKApQdRuTQ4tw/join\n\n00:00 Intro\n00:34 Space+Time = Spacetime\n04:30 Proper Time\n07:59 Time Dilation\n10:21 The Twin Paradox\n13:59 Newton's Bucket\n15:25 Time Slows Down Near Black Holes\n19:30 Learn More on Brilliant\n\n#physics",
