        "title": "Skiing off Huge Cliffs in Jackson Hole | Owen Leeper",
        "description": "Skiing my favorite backcountry lines, cliffs, and couloirs around Jackson Hole in my edit  \"Full Throttle\" from the 2021 season. Follow along on https://www.instagram.com/o_leeps/ for more!\n\nJackson Hole had an epic winter with their third snowiest February ever! We were skiing amazing powder all month and had some epic days on Cody peak in March when the sun came out. I threw one of my biggest front flips in the Targhee backcountry on the sendiest day of the season! I also had a very close call in one of the tight couloirs where I barely saved it on one ski or I would have crashed into the rock wall. Luckily I managed to get my skis under me before having to clear the rocks at the bottom. \n\nThanks for watching and don't forget to subscribe for more content this winter. \n\nMusic:\n\nNGHTMRE & Big Gigantic - Like That\nCourtesy of Mad Decent\n\n\"What Ya Gonna Do\"\nPerformed by Shangrii-La\nCourtesy of Position Music\n\n\"Check It Out\"\nPerformed by Oh The Larceny\nCourtesy of Position Music\n\nGet Pretty Fly (For A White Guy) by The Offspring here https://lickd.lnk.to/5ZIgvRID!O_leeps%20%7C%20Big%20Mountain%20Ski%20Videos \nLicense ID: dbJEgqk5ZjA\nGet this and other songs for your next YouTube video at https://lickd.co",
