        "description": "La und√©cima edici√≥n del ciclo \"El Mundo que Queremos\", que anualmente organiza la Fundaci√≥n CajaCanarias dentro la programaci√≥n del Oto√±o Cultural, celebra un coloquio que, bajo el lema general \"saqueo a la democracia\", ha centrado su propuesta dial√©ctica y de reflexi√≥n. En esta ocasi√≥n, y bajo la direcci√≥n y moderaci√≥n del escritor y periodista Fernando Delgado, se reunen en el Espacio Cultural CajaCanarias de Santa Cruz de Tenerife tres certeros analistas de la sociolog√≠a cotidiana y sus consecuencias con respecto a los efectos que la situaci√≥n socioecon√≥mica actual produce en la ciudadan√≠a: el escritor Juan Jos√© Millas; Jos√© Chamizo, ex Defensor del Pueblo de Andaluc√≠a; y Jos√© Miguel Monz√≥n, \"El Gran Wyoming\", disertan acerca del \"abuso de poder y respuesta popular\". \n\nJos√© Miguel Monz√≥n (El Gran Wyoming).- Madrile√±o  del barrio de la Prosperidad, hijo de farmace√∫ticos, es un personaje polifac√©tico que se licenci√≥ en medicina y ha ejercido de m√©dico, humorista, actor, guionista, m√∫sico y actualmente, presentador de uno de los espacios de humor e informaci√≥n que m√°s impacto est√°n teniendo en la audiencia \"El intermedio\" (La Sexta). El Gran Wyoming, abreviado a veces como Gran Wyoming o Wyoming. Ha sido tambi√©n columnista de P√∫blico y sus art√≠culos pueden leerse de nuevo en el diario de Internet Infolibre.\n\nA lo largo de toda su carrera ha recibido innumerables premios, entre otros, el Premio Ondas por su trabajo en El Intermedio y este mismo a√±o el Premio al mejor presentador de Televisi√≥n. Como escritor es autor de: Un vago, dos vagos, tres vagos (Temas de Hoy, 1990), Te quiero personalmente (Anagrama, 1993), Las aventuras del mapache (Alfaguara juvenil,1997), El ni√±o que so√±aba despierto (Agruparte, 2000) y la Colecci√≥n de Cuentos Musicales La mota de polvo.\n\n \n\nJuan Jos√© Mill√°s (Valencia, 1946) es escritor y periodista. En la universidad empez√≥ Filosof√≠a y Letras, que abandon√≥ 